import React from 'react'
import {NavLink} from "react-router-dom";
import classes from '../Nav/Nav.module.css'
import { connect } from 'react-redux'
import {ChangeUrl} from '../../../../redux/NavReducer'


const NavBrand = (props) =>{

	return <section className={classes.section}>
		<div className={classes.Menu}><div className={classes.Menu_text}>brand options</div></div>
		<nav className={classes.block}>
			<NavLink to="/surfapparel/billabong" activeClassName={classes.activeLink} className={classes.Link} 
			onClick={() => {props.ChangeUrl('Brand','billabong')}}> <div className={classes.divfirst}>billabong</div></NavLink>
	        <NavLink to="/surfapparel/element" activeClassName={classes.activeLink} className={classes.Link} 
	        onClick={() => {props.ChangeUrl('Brand','element')}}> <div className={classes.div}>element</div></NavLink>
	        <NavLink to="/surfapparel/o’neill" activeClassName={classes.activeLink} className={classes.Link} 
	        onClick={() => {props.ChangeUrl('Brand','o’neill')}}> <div className={classes.div}>o’neill</div></NavLink>
	        <NavLink to="/surfapparel/oakley" activeClassName={classes.activeLink} className={classes.Link} 
	        onClick={() => {props.ChangeUrl('Brand','oakley')}}> <div className={classes.div}>oakley</div></NavLink>
	        <NavLink to="/surfapparel/reef" activeClassName={classes.activeLink} className={classes.Link} 
	        onClick={() => {props.ChangeUrl('Brand','reef')}}> <div className={classes.div}>reef</div></NavLink>
	        <NavLink to="/surfapparel/quiksilver" activeClassName={classes.activeLink} className={classes.Link} 
	        onClick={() => {props.ChangeUrl('Brand','quiksilver')}}> <div className={classes.divfirst}>quiksilver</div></NavLink>
	        <NavLink to="/surfapparel/ripcurl" activeClassName={classes.activeLink} className={classes.Link} 
	        onClick={() => {props.ChangeUrl('Brand','ripcurl')}}> <div className={classes.div}>ripcurl</div></NavLink>
	        <NavLink to="/surfapparel/jackss" activeClassName={classes.activeLink} className={classes.Link} 
	        onClick={() => {props.ChangeUrl('Brand','jackss')}}> <div className={classes.divend}>jackss</div></NavLink>
        </nav>
	</section>

}
const mapStateToProps = (state) => {
    return{

    }
}

export default connect()(NavBrand)
